window.addEventListener('DOMContentLoaded', () => {
    const tiles = Array.from(document.querySelectorAll('.tile'));
    const playerDisplay = document.querySelector('.display-player');
    const resetButton = document.querySelector('#reset');
    const announcer = document.querySelector('.announcer');

    let board = ['', '', '', '', '', '', '', '', ''];
    let currentPlayer;
    if (Math.round(Math.random())) {
        currentPlayer = 'O';
    } else {
        currentPlayer = 'X';
    }
    currentPlayer = 'O';
    let isGameActive = true;

    const PLAYERX_WON = 'PLAYERX_WON';
    const PLAYERO_WON = 'PLAYERO_WON';
    const TIE = 'TIE';

    const winningConditions = [
        [0, 1, 2],
        [3, 4, 5],
        [6, 7, 8],
        [0, 3, 6],
        [1, 4, 7],
        [2, 5, 8],
        [0, 4, 8],
        [2, 4, 6]
    ];

    playerDisplay.innerText = currentPlayer;
    playerDisplay.classList.add(`player${currentPlayer}`);

    setInterval(() => {
        if (currentPlayer === 'O' && board.indexOf("") !== -1 && isGameActive) {
            let i = findNext();
            userAction(tiles[i], i, true);
        }
    }, 500);

    function handleResultValidation() {
        let roundWon = false;
        for (let i = 0; i <= 7; i++) {
            const winCondition = winningConditions[i];
            const a = board[winCondition[0]];
            const b = board[winCondition[1]];
            const c = board[winCondition[2]];
            if (a === '' || b === '' || c === '') {
                continue;
            }
            if (a === b && b === c) {
                roundWon = true;
                break;
            }
        }

        if (roundWon) {
            announce(currentPlayer === 'X' ? PLAYERX_WON : PLAYERO_WON);
            isGameActive = false;
            return;
        }

        if (!board.includes(''))
            announce(TIE);
    }

    const announce = (type) => {
        switch (type) {
            case PLAYERO_WON:
                announcer.innerHTML = 'Player <span class="playerO">O</span> Won';
                break;
            case PLAYERX_WON:
                announcer.innerHTML = 'Player <span class="playerX">X</span> Won';
                break;
            case TIE:
                announcer.innerText = 'Tie';
        }
        announcer.classList.remove('hide');
    };

    const isValidAction = (tile) => {
        if (tile.innerText === 'X' || tile.innerText === 'O') {
            return false;
        }

        return true;
    };

    const updateBoard = (index) => {
        board[index] = currentPlayer;
    }

    const changePlayer = () => {
        playerDisplay.classList.remove(`player${currentPlayer}`);
        currentPlayer = currentPlayer === 'X' ? 'O' : 'X';
        playerDisplay.innerText = currentPlayer;
        playerDisplay.classList.add(`player${currentPlayer}`);
    }

    const userAction = (tile, index, machineClick) => {
        // It is machine's turn but user clicks the board
        if (!machineClick && currentPlayer === 'O') {
            return;
        }
        if (isValidAction(tile) && isGameActive) {
            tile.innerText = currentPlayer;
            tile.classList.add(`player${currentPlayer}`);
            updateBoard(index);
            handleResultValidation();
            changePlayer();
        }
    }

    const resetBoard = () => {
        board = ['', '', '', '', '', '', '', '', ''];
        isGameActive = true;
        announcer.classList.add('hide');

        if (Math.round(Math.random())) {
            changePlayer();
        }

        tiles.forEach(tile => {
            tile.innerText = '';
            tile.classList.remove('playerX');
            tile.classList.remove('playerO');
        });
    }

    tiles.forEach((tile, index) => {
        tile.addEventListener('click', () => userAction(tile, index, false));
    });

    resetButton.addEventListener('click', resetBoard);


    const findNext = () => {
        let x = [];
        board.forEach((b)=>{
            switch (b) {
                case 'X':
                    x.push(-1);
                    break;
                case 'O':
                    x.push(1);
                    break;
                default:
                    x.push(0);
                    break;
            }
        })
        let key = JSON.stringify(x);
        let index = nexts[key];

        // found next
        if (index !== undefined) {
            console.log("Next by Model:", index);
            return index;
        }
        // next move not found
        else {
            let possible_nexts = [];
            x.forEach((x_, i)=>{
                if (x_ === 0) {
                    possible_nexts.push(i);
                }
            })
            let random_next_index = Math.floor(Math.random() * possible_nexts.length);
            console.log("Next by Random:", index);
            return possible_nexts[random_next_index];
        }

    }
});

